actionConfiguration.body:
() => {
  const regex = /@(\d+\.\d+),(\d+\.\d+),/gm;
  const str = CustomersTable.selectedRow.gmap;
  let m = regex.exec(str);
  JSObject1.loc = {
    lat: parseFloat(m[1]),
    long: parseFloat(m[2]),
    title: CustomersTable.selectedRow.name
  };
  return JSObject1.loc;
}

